<h2 style="margin: 0">1</h2>

 activation of extranuclear signaling pathways in regulating p53 expression in vascular endothelial cells . We previously showed that progesterone ( P4 ) inhibited the proliferation of human umbilical vein endothelial cells ( HUVECs ) through a p53 - dependent pathway . Now we investigated further the molecular mechanism underlying the hormone activity . In cultured HUVECs , P4 increased the protein levels of phosphorylated Src ( p-Src ) ,

 , and

 . The levels of p-Src and p-Src-progesterone receptor complex in HUVECs were increased by P4 treatment . These effects were blocked by pretreatment with a progesterone receptor antagonist ,

 . The P4 - induced increase in p53 transactivity was abolished by pretreatment with Src kinase inhibitors . Moreover , administration with cSrc antisense oligonucleotide prevented the P4 - induced increases of the levels of p53 mRNA and protein . These data suggest that P4 - induced up-regulation of p53 might be mediated through activation of cSrc . Pretreatment with Src kinase inhibitors also prevented P4 - induced membrane translocation of Kras and increases of the protein levels of phosphorylated Raf and phosphorylated

 . Transfection with dominant-negative

 prevented the P4 - induced increases of protein level and promoter activity of p53 and a decrease of thymidine incorporation . P4 also increased nuclear factor-B ( NF-B ) nuclear translocation and NF-B binding onto the p53 promoter . These effects were abolished by pretreatment with

 inhibitors . The P4 - induced up-regulation of the p53 promoter activity was prevented by preadministration with dominant-negative

 or NF-B inhibitors . Taken together , our data suggest that the cSrc / Kras /

 / NF-B signaling pathway contributes to the P4 - induced up-regulation of p53 in HUVECs . These findings highlight progesterone receptor activation of extranuclear signaling pathways in regulating p53 and cell cycle progression in HUVECs .</div>

 -  . Collectively , our data indicate that MS induces

 production in VSMC via activation of Akt pathway , that is mediated by activation of

 -  signaling pathways .</div>

<h2 style="margin: 0">6</h2>

<div class="entities" style="line-height: 2.5; direction: ltr">
<mark class="entity" style="background: linear-gradient(90deg, #333366, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">
    P04150
    <span style="font-size: 0.8em; font-weight: bold; line-height: 1; border-radius: 0.35em; text-transform: uppercase; vertical-align: middle; margin-left: 0.5rem">REA</span>
</mark>
 signaling in a bronchial epithelial cell line . Glucocorticoids are an effective anti-inflammatory therapy for the treatment of asthma . The anti-inflammatory effects of glucocorticoids may be due to the inhibition of transcription factors that regulate cytokine synthesis . Because of the potential role of the bronchial epithelium in asthmatic inflammation and the possibility that this cell may be the main target of inhaled glucocorticoids , we have characterized glucocorticoid receptors ( GR ) and GR signaling in the human bronchial epithelial cell line BEAS - 2B . Western blot analysis and radioligand binding studies demonstrated that BEAS - 2B cells have functional GR that bind to dexamethasone ( DB00514 ) ( dissociation constant = 5.6 nM and maximal density of binding sites = 228 + / - 3.3 fmol / mg protein ) . GR were activated by DB00514 as assessed using a glucocorticoid-responsive reporter plasmid . Transfection of BEAS - 2B cells with an activator protein - 1 ( AP - 1 ) reporter construct followed by 12 - O-tetradecanoylphorbol - 13 - acetate ( TPA ) treatment resulted in a fivefold induction of reporter gene activity . Transfection with a nuclear factor ( NF ) - kappa B reporter construct followed by tumor necrosis factor-alpha ( 
<mark class="entity" style="background: linear-gradient(90deg, #333366, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">
    P01375
    <span style="font-size: 0.8em; font-weight: bold; line-height: 1; border-radius: 0.35em; text-transform: uppercase; vertical-align: middle; margin-left: 0.5rem">REA</span>
</mark>
 ) treatment resulted in a 10 - fold induction of reporter gene activity . DB00514 ( 10 ( - 7 ) M ) markedly repressed both the induced AP - 1 and NF-kappa B activity . The GR antagonist 
<mark class="entity" style="background: linear-gradient(90deg, #003300, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">
    DB00834
    <span style="font-size: 0.8em; font-weight: bold; line-height: 1; border-radius: 0.35em; text-transform: uppercase; vertical-align: middle; margin-left: 0.5rem">SUB</span>
</mark>
 inhibited the repressive effect of DB00514 on 
<mark class="entity" style="background: linear-gradient(90deg, #333366, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">
    P01375
    <span style="font-size: 0.8em; font-weight: bold; line-height: 1; border-radius: 0.35em; text-transform: uppercase; vertical-align: middle; margin-left: 0.5rem">REA</span>
</mark>
 - induced NF-kappa B activity by 81 % but only counteracted the repressive effect of DB00514 on TPA-induced AP - 1 activity by 43 % . These studies demonstrate that cross-signaling between AP - 1 and NF-kappa B with GR may explain the anti-inflammatory properties of glucocorticoids in airway epithelial cells .</div>

<h2 style="margin: 0">7</h2>

<div class="entities" style="line-height: 2.5; direction: ltr">An endothelial nitric oxide synthase inhibitor aggravates DB03429 - induced acute pancreatitis in rats . To clarify the role of nitric oxide ( NO ) in the development and progression of acute pancreatitis , we investigated the effect of different NO synthase inhibitors and NO donors on experimental pancreatitis in rats . Closed duodenal loop ( DB03429 ) - induced pancreatitis was produced in male Wistar rats , and the animals were treated with normal saline , the NO-synthase substrate L-arginine , the NO donor S-nitroso-N-acetylpenicillamine , aminoguanidine , which is a more powerful inhibitor of inducible NO synthase ( 
<mark class="entity" style="background: linear-gradient(90deg, #333366, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">

</mark>
 ) than is endothelial NO synthase ( 
<mark class="entity" style="background: linear-gradient(90deg, #333366, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">

</mark>
 ) , and N-nitro-L-arginine methyl ester ( L-NAME ) , a more powerful inhibitor of 
<mark class="entity" style="background: linear-gradient(90deg, #333366, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">
    P29474

</mark>
 than of 
<mark class="entity" style="background: linear-gradient(90deg, #333366, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">
    P35228
    <span style="font-size: 0.8em; font-weight: bold; line-height: 1; border-radius: 0.35em; text-transform: uppercase; vertical-align: middle; margin-left: 0.5rem">REA</span>
</mark>
 . All drugs were infused intravenously during a period of 6 or 12 h in each group . Pancreatic tissue was removed at 6 and 12 h after creating the DB03429 . L - DB00125 , S-nitroso-N-acetyl-penicillamine , and aminoguanidine treatment had no effect on the elevation of serum pancreatic enzymes , whereas L-NAME administration significantly exacerbated their elevation . Pathologically , L-NAME treatment resulted in a significantly worse histologic score at 6 and 12 h , especially in terms of the degree of hemorrhage , acinar cell necrosis , and microvascular thrombosis . Addition of L-arginine clearly reversed the effect of L-NAME . Neither the NO substrate nor NO donor could inhibit the progression of hemorrhagic pancreatitis in DB03429 - induced pancreatitis .

</mark>
 had no effect on the severity of the pancreatitis . We therefore concluded that NO production by 
<mark class="entity" style="background: linear-gradient(90deg, #333366, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">

</mark>
 may play a significant role in preventing the development and progression of acute pancreatitis .</div>

 expression by dexamethasone and the molecular and signaling mechanisms involved . METHODS : House ear institute-organ of Corti 1 ( HEI-OC 1 ) cells were used and exposed to IL - 1 with / without dexamethasone .

 , was used to see the role of dexamethasone . PD98059 ( an extracellular signal-regulated kinases [ ERKs ] inhibitor ) , SB203580 ( a p38 mitogen-activated protein kinases [ MAPK ] inhibitor ) , SP600125 ( a c-Jun N-terminal kinase [ JNK ] inhibitor ) were also used to see the role of MAPKs signaling pathway ( s ) in IL - 1 - induced

 expression in HEI-OC 1 cells . Reverse transcription-polymerase chain reaction and gelatin zymography were used to measure mRNA expression level of

 and activity of

 , respectively . RESULTS : Treatment with IL - 1 - induced the expression of

 in a dose - and time-dependent manner . IL - 1 ( 1 ng / mL ) - induced

 expression was inhibited by dexamethasone . Interestingly , p38 MAPK inhibitor , SB203580 , significantly inhibited IL - 1 - induced

 activity . However , inhibition of JNKs and ERKs had no effect on the IL - 1 - induced

 expression . CONCLUSION : These results suggest that the pro-inflammatory cytokine IL - 1 strongly induces

<h2 style="margin: 0">9</h2>

<div class="entities" style="line-height: 2.5; direction: ltr">Gene therapy-mediated delivery of targeted cytotoxins for glioma therapeutics . Restricting the cytotoxicity of anticancer agents by targeting receptors exclusively expressed on tumor cells is critical when treating infiltrative brain tumors such as glioblastoma multiforme ( GBM ) . GBMs express an 
<mark class="entity" style="background: linear-gradient(90deg, #333366, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">
    P35225
    <span style="font-size: 0.8em; font-weight: bold; line-height: 1; border-radius: 0.35em; text-transform: uppercase; vertical-align: middle; margin-left: 0.5rem">REA</span>
</mark>
 receptor ( IL13R2 ) that differs from the physiological 
<mark class="entity" style="background: linear-gradient(90deg, #333366, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">
    P24394
    <span style="font-size: 0.8em; font-weight: bold; line-height: 1; border-radius: 0.35em; text-transform: uppercase; vertical-align: middle; margin-left: 0.5rem">REA</span>
</mark>
 / IL13R receptor . We developed a regulatable adenoviral vector ( Ad.mhIL-4.TRE.mhIL - 13 - PE ) encoding a mutated human 
<mark class="entity" style="background: linear-gradient(90deg, #333366, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">
    P35225
    <span style="font-size: 0.8em; font-weight: bold; line-height: 1; border-radius: 0.35em; text-transform: uppercase; vertical-align: middle; margin-left: 0.5rem">REA</span>
</mark>
 fused to Pseudomonas exotoxin ( mhIL - 13 - PE ) that specifically binds to IL13R2 to provide sustained expression , effective anti-GBM cytotoxicity , and minimal neurotoxicity . The therapeutic Ad also encodes mutated human 
<mark class="entity" style="background: linear-gradient(90deg, #333366, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">
    P05112
    <span style="font-size: 0.8em; font-weight: bold; line-height: 1; border-radius: 0.35em; text-transform: uppercase; vertical-align: middle; margin-left: 0.5rem">REA</span>
</mark>
 that binds to the physiological 
<mark class="entity" style="background: linear-gradient(90deg, #333366, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">
    P24394
    <span style="font-size: 0.8em; font-weight: bold; line-height: 1; border-radius: 0.35em; text-transform: uppercase; vertical-align: middle; margin-left: 0.5rem">REA</span>
</mark>
 / IL13R without interacting with IL13R2 , thus inhibiting potential binding of mhIL - 13 - PE to normal brain cells . Using intracranial GBM xenografts and syngeneic mouse models , we tested the Ad.mhIL-4.TRE.mhIL - 13 - PE and two protein formulations , hIL - 13 - PE used in clinical trials ( 
<mark class="entity" style="background: linear-gradient(90deg, #CC9966, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">
    DB05305
    <span style="font-size: 0.8em; font-weight: bold; line-height: 1; border-radius: 0.35em; text-transform: uppercase; vertical-align: middle; margin-left: 0.5rem">MEN</span>
</mark>
 ) and a second-generation mhIL - 13 - PE . 
<mark class="entity" style="background: linear-gradient(90deg, #CC9966, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">
    DB05305
    <span style="font-size: 0.8em; font-weight: bold; line-height: 1; border-radius: 0.35em; text-transform: uppercase; vertical-align: middle; margin-left: 0.5rem">MEN</span>
</mark>
 doubled median survival without eliciting long-term survival and caused severe neurotoxicity ; mhIL - 13 - PE led to  40 % long-term survival , eliciting severe neurological toxicity at the high dose tested . In contrast , Ad-mediated delivery of mhIL - 13 - PE led to tumor regression and long-term survival in over 70 % of the animals , without causing apparent neurotoxicity . Although 
<mark class="entity" style="background: linear-gradient(90deg, #CC9966, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">
    DB05305
    <span style="font-size: 0.8em; font-weight: bold; line-height: 1; border-radius: 0.35em; text-transform: uppercase; vertical-align: middle; margin-left: 0.5rem">MEN</span>
</mark>
 was originally developed to target GBM , when tested in a phase III trial it failed to achieve clinical endpoints and revealed neurotoxicity . Limitations of

    DB05305
    <span style="font-size: 0.8em; font-weight: bold; line-height: 1; border-radius: 0.35em; text-transform: uppercase; vertical-align: middle; margin-left: 0.5rem">MEN</span>
</mark>
 include its short half-life , which demanded frequent or continued administration , and binding to 
<mark class="entity" style="background: linear-gradient(90deg, #333366, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">

    <span style="font-size: 0.8em; font-weight: bold; line-height: 1; border-radius: 0.35em; text-transform: uppercase; vertical-align: middle; margin-left: 0.5rem">REA</span>
</mark>
 / IL13R , present in normal brain cells . These shortcomings were overcome by our therapeutic Ad , thus representing a significant advance in the development of targeted therapeutics for GBM .</div>

<h2 style="margin: 0">10</h2>

<div class="entities" style="line-height: 2.5; direction: ltr">Thromboxane A ( 2 ) generation , in the absence of platelet

</mark>
 activity , in patients with and without atherothrombotic myocardial infarction . BACKGROUND : 
<mark class="entity" style="background: linear-gradient(90deg, #CC9966, #CC9966); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">
    DB00945

</mark>

<mark class="entity" style="background: linear-gradient(90deg, #CC9966, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">
    DB00945

 ' s therapeutic action is via inhibition of platelet cyclooxygenase 1 (

</mark>
 ) thromboxane A2 ( TxA 2 ) production . The aim of this study was to evaluate TxA 2 production , in the absence of platelet 
<mark class="entity" style="background: linear-gradient(90deg, #333366, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">
    P23219
    <span style="font-size: 0.8em; font-weight: bold; line-height: 1; border-radius: 0.35em; text-transform: uppercase; vertical-align: middle; margin-left: 0.5rem">REA</span>
</mark>
 activity , in coronary atherosclerotic heart disease patients with and without atherothrombotic myocardial infarction ( MI ) . METHODS AND RESULTS : TxA 2 production , in the absence of platelet 
<mark class="entity" style="background: linear-gradient(90deg, #333366, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">
    P23219
    <span style="font-size: 0.8em; font-weight: bold; line-height: 1; border-radius: 0.35em; text-transform: uppercase; vertical-align: middle; margin-left: 0.5rem">REA</span>
</mark>
 activity , was evaluated in 44 patients taking aspirin on 3 commercially available assays that detect metabolites of TxA 2 in the urine . Two assays measure urine 11 - dehydro-thromboxane B2 ( TxB 2 ) alone and 1 measures urine 11 - dehydro-TxB 2 plus 11 - dehydro -2,3- dinor-TxB 2 . Platelet 
<mark class="entity" style="background: linear-gradient(90deg, #333366, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">
    P23219
    <span style="font-size: 0.8em; font-weight: bold; line-height: 1; border-radius: 0.35em; text-transform: uppercase; vertical-align: middle; margin-left: 0.5rem">REA</span>
</mark>
 inhibition was confirmed on &lt; 10 % platelet aggregation in response to  1 mmol / L arachidonic acid . Median urine 11 - dehydro-TxB 2 was no different in those with and without a diagnosis of atherothrombotic MI ( 325 vs . 311 pg / mg creatinine , P= 0.59 via polyclonal ELISA ) and ( 312 vs . 244 pg / mg creatinine , P= 0.11 via LC-MS / MS ) . Median urine 11 - dehydro-TxB 2 plus 11 - dehydro -2,3- dinor-TxB 2 , however , was higher in those with vs . those without a diagnosis of atherothrombotic MI ( 1,035 vs . 606 pg / mg creatinine , P= 0.03 via monoclonal ELISA ) . CONCLUSIONS : Differences in TxA 2 production , in the absence of platelet 
<mark class="entity" style="background: linear-gradient(90deg, #333366, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">

</mark>
 activity , between those with vs . without atherothrombotic MI were not observed when TxA 2 generation was assessed on 11 - dehydro-TxB 2 production alone ( polyclonal ELISA or LC-MS / MS ) , but differences were observed when TxA 2 generation was assessed using 11 - dehydro-TxB 2 plus 11 - dehydro -2,3- dinor-TxB 2 ( monoclonal ELISA ) . These findings highlight important differences between different commercially available assays for TxA 2 generation and suggest that 11 - dehydro -2,3- dinor-TxB 2 may be critical to the biology of atherothrombosis .</div>

 showed reduced expression ( P &lt; 0.05 ) and the AR-transfected MsC showed increased expression ( P &lt; 0.05 ) . The normal MsC showed activation of

<h2 style="margin: 0">13</h2>

<div class="entities" style="line-height: 2.5; direction: ltr">
<mark class="entity" style="background: linear-gradient(90deg, #333366, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">
    P04150
    <span style="font-size: 0.8em; font-weight: bold; line-height: 1; border-radius: 0.35em; text-transform: uppercase; vertical-align: middle; margin-left: 0.5rem">REA</span>
</mark>
 antagonism disrupts the reconsolidation of social reward-related memories in rats . Reconsolidation is the process whereby consolidated memories are destabilized upon retrieval and restabilized to persist for later use . Although the neurobiology of the reconsolidation of both appetitive and aversive memories has been intensively investigated , reconsolidation of memories of physiologically relevant social rewards has received little attention . Social play , the most characteristic social behaviour displayed by young mammals , is highly rewarding , illustrated by the fact that it can induce conditioned place preference ( CPP ) . Here , we investigated the role of signalling mechanisms implicated in memory processes , including reconsolidation , namely glucocorticoid , mineralocorticoid , DB01221 glutamatergic and 
<mark class="entity" style="background: linear-gradient(90deg, #333366, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">
    P21554
    <span style="font-size: 0.8em; font-weight: bold; line-height: 1; border-radius: 0.35em; text-transform: uppercase; vertical-align: middle; margin-left: 0.5rem">REA</span>
</mark>
 cannabinoid receptors , in the reconsolidation of social play-induced CPP in rats . Systemic treatment with the glucocorticoid receptor antagonist mifepristone before , but not immediately after , retrieval disrupted the reconsolidation of social play-induced CPP . 
<mark class="entity" style="background: linear-gradient(90deg, #003300, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">
    DB00834
    <span style="font-size: 0.8em; font-weight: bold; line-height: 1; border-radius: 0.35em; text-transform: uppercase; vertical-align: middle; margin-left: 0.5rem">SUB</span>
</mark>
 did not affect social play-induced CPP in the absence of memory retrieval . Treatment with the DB01221 receptor antagonist MK - 801 modestly affected the reconsolidation of social play-induced CPP . However , the reconsolidation of social play-induced CPP was not affected by treatment with the mineralocorticoid and 
<mark class="entity" style="background: linear-gradient(90deg, #333366, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">
    P21554
    <span style="font-size: 0.8em; font-weight: bold; line-height: 1; border-radius: 0.35em; text-transform: uppercase; vertical-align: middle; margin-left: 0.5rem">REA</span>
</mark>
 cannabinoid receptor antagonists spironolactone and rimonabant , respectively . We conclude that glucocorticoid neurotransmission mediates the reconsolidation of social reward-related memories in rats . These data indicate that the neural mechanisms of the reconsolidation of social reward-related memories only partially overlap with those underlying the reconsolidation of other reward-related memories .</div>

 . Receptor antagonists for

 receptors . In this regard , ' pure ' compounds exclusively acting on the D2 and

<div class="entities" style="line-height: 2.5; direction: ltr">Endocannabinoids as autoregulatory signaling molecules : coupling to nitric oxide and a possible association with the relaxation response . Endocannabinoid signaling processes are present in diverse organisms and in organisms 500 million years divergent in evolution . Cannabinoid receptor - 1 expression (

 immunoreactive components are present as is its coupling to anandamide-stimulated 
<mark class="entity" style="background: linear-gradient(90deg, #333366, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">

 - derived NO production , which exerts an autoregulatory role on

 and CB2 , as demonstrated in leukocytes derived from

 by 2 - AG in a manner that is independent of

 ) agonists are clear . In clinical practice ,
